import React, { useEffect, useState, useRef } from 'react';
import { useLocation } from 'react-router-dom';
import * as d3 from 'd3';
import './Prediction.css';

const GeneratedRentPrediction = () => {
    const location = useLocation();
    const { suburb, houseType, numRooms, rentalPeriod, predictedPrice } = location.state || {};
    const normalizedSuburb = suburb
        .toLowerCase()
        .split(' ')
        .map(word => word.charAt(0).toUpperCase() + word.slice(1))
        .join(' ');

    const [historicalPrices, setHistoricalPrices] = useState(null);
    const svgRef = useRef(); // Reference for D3 line chart
    const stackedSvgRef = useRef(); // Reference for D3 stacked area chart

    useEffect(() => {
        const fetchHistoricalPrices = async () => {
            try {
                const response = await fetch('http://localhost:8000/getHistoricalRentPrices', {
                    method: 'POST',
                    headers: {
                        'Content-Type': 'application/json',
                    },
                    body: JSON.stringify({
                        suburb: suburb,
                        numRooms: numRooms,
                        houseType: houseType,
                        monthsBack: 6,
                    }),
                });
                if (!response.ok) {
                    throw new Error("Failed to fetch historical rent prices");
                }
                const data = await response.json();
                setHistoricalPrices(data.historical_data);
            } catch (error) {
                console.error("Error fetching historical rent prices:", error);
            }
        };

        fetchHistoricalPrices();
    }, [suburb, numRooms, houseType]);

    // Render existing line chart
    useEffect(() => {
        if (historicalPrices) {
            const width = 600;
            const height = 400;
            const margin = { top: 20, right: 30, bottom: 70, left: 60 };

            const parseDate = d3.timeParse('%m-%Y');
            const data = historicalPrices
                .map(d => ({
                    date: parseDate(d.date),
                    price: +d.price,
                }))
                .filter(d => d.date);

            const xScale = d3.scaleTime()
                .domain(d3.extent(data, d => d.date))
                .range([margin.left, width - margin.right]);

            const yScale = d3.scaleLinear()
                .domain([0, d3.max(data, d => d.price)]).nice()
                .range([height - margin.bottom, margin.top]);

            const line = d3.line()
                .x(d => xScale(d.date))
                .y(d => yScale(d.price));

            d3.select(svgRef.current).selectAll('*').remove();

            const svg = d3.select(svgRef.current)
                .attr('width', width)
                .attr('height', height);

            svg.append('g')
                .attr('transform', `translate(0,${height - margin.bottom})`)
                .call(d3.axisBottom(xScale).tickFormat(d3.timeFormat('%b %Y')))
                .selectAll("text")
                .attr("transform", "rotate(-45)")
                .style("text-anchor", "end");

            svg.append('g')
                .attr('transform', `translate(${margin.left},0)`)
                .call(d3.axisLeft(yScale));

            svg.append('path')
                .datum(data)
                .attr('fill', 'none')
                .attr('stroke', 'steelblue')
                .attr('stroke-width', 2)
                .attr('d', line);
            
            svg.selectAll("circle")
                .data(data)
                .join("circle")
                .attr("cx", d => xScale(d.date))
                .attr("cy", d => yScale(d.price))
                .attr("r", 4)
                .attr("fill", "steelblue");
        }
    }, [historicalPrices]);

    // Render stacked area chart
    useEffect(() => {
        if (historicalPrices) {
            const width = 600;
            const height = 400;
            const margin = { top: 20, right: 30, bottom: 70, left: 60 };

            const parseDate = d3.timeParse('%m-%Y');
            const data = historicalPrices
                .map(d => ({
                    date: parseDate(d.date),
                    price: +d.price,
                    type: d.type // assuming a 'type' field in data
                }))
                .filter(d => d.date);

            const keys = [...new Set(data.map(d => d.type))];
            const stackedData = d3.stack()
                .keys(keys)
                .value((d, key) => d.find(item => item.type === key)?.price || 0)
                (d3.groups(data, d => d.date).map(([date, values]) => ({ date, ...Object.fromEntries(values.map(d => [d.type, d.price])) })));

            const xScale = d3.scaleTime()
                .domain(d3.extent(data, d => d.date))
                .range([margin.left, width - margin.right]);

            const yScale = d3.scaleLinear()
                .domain([0, d3.max(stackedData, layer => d3.max(layer, d => d[1]))]).nice()
                .range([height - margin.bottom, margin.top]);

            const colorScale = d3.scaleOrdinal()
                .domain(keys)
                .range(d3.schemeCategory10);

            d3.select(stackedSvgRef.current).selectAll('*').remove();

            const svg = d3.select(stackedSvgRef.current)
                .attr('width', width)
                .attr('height', height);

            const area = d3.area()
                .x(d => xScale(d.data.date))
                .y0(d => yScale(d[0]))
                .y1(d => yScale(d[1]));

            svg.selectAll('.layer')
                .data(stackedData)
                .join('path')
                .attr('class', 'layer')
                .attr('d', area)
                .style('fill', ({ key }) => colorScale(key))
                .style('opacity', 0.7);

            svg.append('g')
                .attr('transform', `translate(0,${height - margin.bottom})`)
                .call(d3.axisBottom(xScale).tickFormat(d3.timeFormat('%b %Y')))
                .selectAll("text")
                .attr("transform", "rotate(-45)")
                .style("text-anchor", "end");

            svg.append('g')
                .attr('transform', `translate(${margin.left},0)`)
                .call(d3.axisLeft(yScale));
        }
    }, [historicalPrices]);

    return (
        <div className='prediction-container'>
            <h2>
                Generated rent predictions for a {numRooms} bedroom {houseType} in {normalizedSuburb} for the next {rentalPeriod} months
            </h2>
            <h3>Average rent per week would be {predictedPrice} AUD</h3>
            <div className='historical-price-chart'>
                <h4>Historical Rent Prices (last 6 months):</h4>
                <svg ref={svgRef}></svg>
            </div>
            <div className='stacked-area-chart'>
                <h4>Rental Prices by Property Type Over Time:</h4>
                <svg ref={stackedSvgRef}></svg>
            </div>
        </div>
    );
};

export default GeneratedRentPrediction;
